    public override void CreateNewOutputRows()
    {
        /*
          Add rows by calling the AddRow method on the member variable named "&lt;Output Name&gt;Buffer".
          For example, call MyOutputBuffer.AddRow() if your output was named "MyOutput".
        */

        string filelocation = Variables.JSONFILEPATH;

        String jsonFileContent = File.ReadAllText(filelocation);

        JavaScriptSerializer js = new JavaScriptSerializer() { MaxJsonLength = Int32.MaxValue };
    
        List&lt;SBAFiles&gt; ProductListV = js.Deserialize&lt;List&lt;SBAFiles&gt;&gt;(jsonFileContent);
        foreach (SBAFiles ProductList in ProductListV)
        {
            Output0Buffer.AddRow();
            Output0Buffer.AsOfDate = ProductList.AsOfDate;
            Output0Buffer.Program = ProductList.Program;
            Output0Buffer.BorrowersName = ProductList.BorrowersName;
            Output0Buffer.BorrowersCity = ProductList.BorrowersCity;
            Output0Buffer.BorrowersStreet = ProductList.BorrowersStreet;
            Output0Buffer.BorrowersState = ProductList.BorrowersState;
            Output0Buffer.BorrowersZip = ProductList.BorrowersZip;
            Output0Buffer.BankName = ProductList.BankName;
            Output0Buffer.BankStreet = ProductList.BankStreet;
            Output0Buffer.BankCity = ProductList.BankCity;
            Output0Buffer.BankState = ProductList.BankState;
            Output0Buffer.BankZip = ProductList.BankZip;
            Output0Buffer.GrossApproval = ProductList.GrossApproval;
            Output0Buffer.SBAGuaranteedApproval = ProductList.SBAGuaranteedApproval;
            Output0Buffer.ApprovalDate = ProductList.ApprovalDate;
            Output0Buffer.ApprovalFiscalYear = ProductList.ApprovalFiscalYear;
            Output0Buffer.FirstDisbursementDate = ProductList.FirstDisbursementDate;
            Output0Buffer.DeliveryMethod = ProductList.DeliveryMethod;
            Output0Buffer.subpgmdesc = ProductList.subpgmdesc;
            Output0Buffer.InitialInterestRate = ProductList.InitialInterestRate;
            Output0Buffer.TermInMonths = ProductList.TermInMonths;
            Output0Buffer.NaicsCode = ProductList.NaicsCode;
            Output0Buffer.NaicsDescription = ProductList.NaicsDescription;
            Output0Buffer.FranchiseCode = ProductList.FranchiseCode;
            Output0Buffer.FranchiseName = ProductList.FranchiseName;
            Output0Buffer.ProjectCounty = ProductList.ProjectCounty;
            Output0Buffer.ProjectState = ProductList.ProjectState;
            Output0Buffer.SBADistrictOffice = ProductList.SBADistrictOffice;
            Output0Buffer.CongressionalDistrict = ProductList.CongressionalDistrict;
            Output0Buffer.BusinessType = ProductList.BusinessType;
            Output0Buffer.LoanStatus = ProductList.LoanStatus;
            Output0Buffer.PaidInFullDate = ProductList.PaidInFullDate;
            Output0Buffer.ChargeOffDate = ProductList.ChargeOffDate;
            Output0Buffer.GrossChargeOffAmount = ProductList.GrossChargeOffAmount;
            Output0Buffer.RevolverStatus = ProductList.RevolverStatus;
            Output0Buffer.JobsSupported = ProductList.JobsSupported;
        }

    }
